// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import RadioPlayer from './components/RadioPlayer';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/radio" component={RadioPlayer} />
          {/* Add other routes here */}
          <Route path="/" exact>
            <h1>Welcome to the Radio Streaming Website</h1>
            {/* Home page content */}
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
